import ReactDOM from "react-dom";
import React from "react";

ReactDOM.render(
  React.createElement(
    "div",
    "C",
    React.createElement("h1", {}, "Qalaysizlar?"),
    React.createElement(
      "div",
      'class="box"',
      React.createElement("p", {}, "Ixtiyoriy matn")
    )
  ),
  document.querySelector("#root")
);
